    this[name] = function() {
      var r = this.root[name].apply(this.root, arguments);
      return r instanceof Cursor ? this : r;
    };
  }

  [
    'apply',
    'chain',
    'get',
    'merge',
    'push',
    'set',
    'splice',
    'unset',
    'unshift',
    'update'
